import {  Link, Route, Routes } from "react-router-dom";

import './null.scss';
import './sidebarMenu.scss';

const menuSidebar = [
   { id: 1, value: "Бестселлеры", url: '/' , element: "bestsellers"},
   { id: 2, value: "Новинки", url: '#', element: "nems" },
   { id: 3, value: "Нехудожественная литература", url: '#', element: "non-fiction" },
   { id: 4, value: "Художественная литература", url: '#', element: "fiction" },
   { id: 5, value: "Детская литература", url: '#', element: "literature for children" },
   { id: 6, value: "Бизнесс литература", url: '#', element: "business literature" },
   { id: 7, value: "Учебная литература", url: '#', element: "education literature" },
   { id: 8, value: "Психология", url: '#', element: "psychology" },
   { id: 9, value: "Комиксы и манга", url: '#', element: "comics and Manga" },
   { id: 10, value: "Изучение иностранных языков", url: '#' , element: "learning foreign languages"},
   { id: 11, value: "Медицина", url: '#', element: "medicine" },
   { id: 12, value: "Кулинария и напитки", url: '#' , element: "cooking & Drink" },
   { id: 13, value: "Красота, здоровья, спорт", url: '#' , element: "beauty, health, sports" },
   { id: 1,value: "Компьютеры и интернет", url: '#' , element: "computers and the Internet" },

];

export const  SidebarMenu = () => {
   return (
      <aside>
         <Link>Бестселлеры</Link><ul>
        {menuSidebar.map((props) => (
          <li key={props.id}>
            <Link to={user.id}>{user.name}</Link>
          </li>
        ))}
      </ul>
      </aside>
   )
}
